from secscan import utils

# Cell

def getCikFilings(cik) :
    restFilingsUrl = f'/submissions/CIK{str(cik).zfill(10)}.json'
    filingsJson = utils.downloadSecUrl(restFilingsUrl, restData=True, toFormat='json')
    return filingsJson